import React from "react";
import { Link } from "react-router-dom";
import "./welcome.css";
import "./login";
const welcome = () => {
  return (
    <div className="intro-page">
      <div className="bg-11-1">
        <span className="w-e-l-c-o-m-e-s-y-o">W e l c o m e s Y o u !</span>
        <button className="rectangle-1">
          <span className="irrigreat">IRRIGREAT</span>
        </button>
        <a className="linking"><Link to="./login"><span className="rectangle-2">
          <span className="login">LOGIN</span>
        </span></Link></a>
      </div>
    </div>
  );
};
export default welcome;
